import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";

import "./assets/css/open-iconic-bootstrap.min.css";
import "./assets/css/animate.css";

import "./assets/css/owl.carousel.min.css";
import "./assets/css/owl.theme.default.min.css";
import "./assets/css/magnific-popup.css";

import "./assets/css/aos.css";

import "./assets/css/ionicons.min.css";

import "./assets/css/bootstrap-datepicker.css";
import "././assets/css/jquery.timepicker.css";


import "./assets/css/flaticon.css";
import "./assets/css/icomoon.css";
import "./assets/css/style.css";


import UserName from "views/username.jsx";
import Simple from "views/Simple.jsx";
import Language from "views/language.jsx";

  import "./assets/js/popper.min.js";
  import "./assets/js/bootstrap.min.js";
  import "./assets/js/jquery.easing.1.3.js";
  import "./assets/js/jquery.waypoints.min.js";
  import "./assets/js/jquery.stellar.min.js";
  import "./assets/js/owl.carousel.min.js";
  import "./assets/js/jquery.magnific-popup.min.js";
  import "./assets/js/aos.js";
  import "./assets/js/jquery.animateNumber.min.js";
  import "./assets/js/bootstrap-datepicker.js";

  import "./assets/js/scrollax.min.js";
  import "https://maps.googleapis.com/maps/api/js?key=AIzaSyBVWaKrjvy3MaE7SQ74_uJiULgl1JY0H2s&sensor=false";
  import "./assets/js/google-map.js";
  import "./assets/js/main.js";


ReactDOM.render(

  <BrowserRouter>
    <Switch>
      <Route path="/" exact render={props => <Simple {...props} />} />
      <Route
        path="/UserName"
        exact
        render={props => <UserName {...props} />}
      />
      <Route path="/Simple" exact render={props => <Simple {...props} />} />
      <Route path="/language" exact render={props => <Language {...props} />} />
      <Redirect to="/" />
    </Switch>
  </BrowserRouter>,

  document.getElementById("root")
);
